import React, { Component } from 'react'

export default class View extends Component {

    constructor(props) {
        super(props)

    }
    
    render() {


        var {match}=this.props.match.params

        return (
            <div>
                
                <h3>VIEW DETAILS  {match.params.idno} </h3>

            </div>
        )
    }
}
